import React from 'react';

function AboutMe() {
  return (
    <div className="about-me">
        <h1>hi, im austin</h1>
        <p>i code from time to time. <br></br> unless generative ai wants to drive...</p>
        <img
        src="../utilities/monstar.png"
        alt="monstar"
        style={{ width: '100%', maxWidth: '500px', margin: '20px auto' }}
        />
    </div>
  );
}

export default AboutMe;
